import { Component } from "kess-flow";

export default class Interval extends Component {
  out1 = "out1";

  count: number;
  timer: NodeJS.Timeout;

  async setup(ctx) {
    await super.setup(ctx);
    this.count = 0;
    this.timer = setInterval(async () => {
      await ctx.output.send({ [this.out1]: ++this.count });
    }, 1000);
  }

  async teardown() {
    await super.teardown();
    clearInterval(this.timer);
    this.count = 0;
  }
}

import { Component } from "kess-flow";

export default class Timer extends Component {
  in1 = "in1";
  out1 = "out1";

  async process({ input, output }) {
    if (!input.has(this.in1)) return;
    const time = new Date().toISOString();
    output.send({ [this.out1]: time });
    console.log(this.constructor.name, this.id, "process", ":", { time });
  }
}

import { Component } from "kess-flow";

export default class Timer extends Component {
  in1 = "in1";
  out1 = "out1";

  count: number;

  async setup(ctx) {
    await super.setup(ctx);
    this.count = 0;
  }

  async process({ input, output }) {
    if (!(await input.has(this.in1))) return;
    this.count++;
    await output.send({ [this.out1]: this.count });
    console.log(this.constructor.name, this.id, "process", ":", {
      count: this.count
    });
  }
}

import { Component } from "kess-flow";

export default class Combiner extends Component {
  in1 = "in1";
  in2 = "in2";
  out1 = "out1";

  async process({ input, output }) {
    if (!(await input.has(this.in1)) || !(await input.has(this.in2))) return;
    const result = {
      time: await input.get(this.in1),
      count: await input.get(this.in2)
    };
    await output.send({ [this.out1]: result });
    console.log(this.constructor.name, this.id, "process", ":", {
      result
    });
  }
}

